description:
Download and Enjoy DoTA Logon Screen





Defense of the Ancients is a game that comes from a map created for Warcraft 3, and from that point has grown to become a game as big as it comes from. In this windows theme we bring 5 fantastic scenes inspired by the heroes of this great game. Enjoy. DoTA contain 5 high quality backgrounds to replace the default Windows Logon Wallpaper.

